// SPDX-License-Identifier: MIT
pragma solidity >0.4.0 <0.9.0;
pragma experimental ABIEncoderV2;

contract doctorPage{
    address admin;
    constructor() {
        admin = msg.sender;
    }

    function getAdmin() view public returns (address){
        return admin;
    }

    struct doctorAddedFiles{
        string fileName;
        string fileType;
        string fileId;
        address doctorId;
        string dateAdded;
    }

    struct doctorPrescription{
        string medicine;
        address doctorId;
        string advice;
        uint256 time;
    }

    modifier isDoctor(address doctor){
        require(msg.sender == doctor, "Only registered doctors are allowed to modify data");
        _;
    }

    mapping (address => doctorAddedFiles[]) patientFiles;
    mapping (address => doctorPrescription[]) patientPrescription;
    
    function addPatientDetails(address _pat, string memory fname, string memory ftype, string memory fId, address docID, string memory date) public isDoctor(docID){
        patientFiles[_pat].push(doctorAddedFiles({
            fileName: fname,
            fileType: ftype,
            fileId: fId,
            doctorId: docID,
            dateAdded: date
        }));
    }

    function getDoctorAddedFiles(address pat) view public returns (doctorAddedFiles[] memory){
        return patientFiles[pat];
    }

    function addDoctorPrescription(address pat, string memory _medicine, address _doctorId, string memory _advice, uint256 _time) public isDoctor(_doctorId){
        patientPrescription[pat].push(doctorPrescription({
            medicine: _medicine,
            doctorId: _doctorId,
            advice: _advice,
            time: _time
        }));
    }

    function getPatientPrescription(address pat) view public returns(doctorPrescription[] memory){
        return patientPrescription[pat];
    }
    
}
